column5:
@bingofuel Aw, man &lt;3 Know you aren't alone in all these BIG heavy feelings. 

I'm learning it is ok to have joy, it is ok to be sad when everyone is happy, it is ok to take care of yourself before everyone else right now.

Tell those stories, share those traditions. &lt;3

