@cmpriest My little weather alert showed "SNOWING NOW" and I looked outside and was like "No, it is not" 

Two minutes later.... 

ALL THE SNOW!

@RAtheRuggedMan @RobZombie Aw, one of my favorite memories. 

He loved loved loved Devil's Rejects and Rob Zombie's films. We made sure to get him out to @SpookyEmpire every year.

I would sit and do his makeup in the hotel room, great memories.

